import "./css/login.css"
import loginImage from "../assets/loginImage.jpg"

const Login = () => {
  return (
    <main>
      <div className="esq">
        <h2>Bem vindo(a) de volta!</h2>
      </div>
      <div className="dir">
        <img src={loginImage} alt="" />
      </div>
    </main>
  );
};

export default Login;
